export const lightTheme = Object.freeze({
  dark: {
    welcome: {
      background: 'linear-gradient(180deg, #ffffff 25%, #bedbb0 92.19%)',
      easedTransition: '350ms ease-in-out',
      cubicTransition: '500ms cubic-bezier(0.175, 0.885, 0.32, 1.275)',
      dndTransition: 'cubic-bezier(0.25, 1, 0.5, 1)',
      blackColor: '#161616',
      whiteColor: '#fff',
      lightGreenGradient:
        'linear-gradient(180deg, #ffffff 25%, #bedbb0 92.19%)',
      darkGreenGradient: 'linear-gradient(180deg, #263238 25%, #37474F 92.19%)',
      lightGreen: '#92E3A9',
      backdropColor: '#706f6f99',
      errorColor: '#fc8181',
    },
  },
});
